"   <ul>",
"    <li class=\"plainItem\">",
"     <a class=\"drug drug_general\" href=\"UTD.htm?3/11/3253?source=related_link\">",
"      Dicloxacillin: Drug information",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"drug drug_patient\" href=\"UTD.htm?2/14/2276?source=related_link\">",
