var title_f16_61_17368="Langerhans histiocytosis CT I";
var content_f16_61_17368=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F58182%7EPULM%2F69891%7EPULM%2F72698&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F58182%7EPULM%2F69891%7EPULM%2F72698&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cystic changes in Langerhans cell histiocytosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 204px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Langerhans cell histiocytosis (eosinophilic granuloma) in an adolescent boy characterized by multiple cysts in the upper and lower lobes. The cysts are interspersed throughout the parenchyma and have a slightly thick wall. A posterior right upper lobe nodule and confluent bibasilar patchy lower lobe opacities are also part of the disease process.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cystic changes in Langerhans cell histiocytosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 364px; height: 225px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Langerhans cell pulmonary histiocytosis (eosinophilic granuloma) in an adolescent boy characterized by multiple cysts in the upper and lower lobes. The cysts are interspersed throughout the parenchyma and have a slightly thick wall. A posterior right upper lobe nodule and confluent bibasilar patchy lower lobe opacities are also part of the disease process.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pulmonary Langerhans cell histiocytosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 304px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High resolution CT with thin section shows the cysts in pulmonary LCH, which vary markedly in size and may be larger than 10 mm. The cysts are bizarre in shape,&nbsp;often closely related to pulmonary arteries, and mimic bronchiectasis. Few nodules are present in this case.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Talmadge E King Jr, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
