var title_f16_61_17373="Dosing regimens for treatment of latent TB";
var content_f16_61_17373=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F65944&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F65944&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dosing regimens for treatment of latent tuberculosis (see text for discussion of clinical approach to selecting a regimen for treatment of latent tuberculosis)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adults",
"       </td>",
"       <td class=\"subtitle1\">",
"        Children &lt;12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"6\">",
"        <strong>",
"         Isoniazid",
"        </strong>",
"        *",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Standard regimen:",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Standard regimen:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        300 mg PO daily for nine months",
"       </td>",
"       <td class=\"indent1\">",
"        10 to 15 mg/kg PO daily for nine months; not to exceed 300 mg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Alternate regimens:",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Alternate regimen:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        300 mg PO daily for six months",
"       </td>",
"       <td class=\"indent1\" rowspan=\"3\">",
"        20 to 30 mg/kg PO twice weekly for nine months",
"        <sup>",
"         &bull;",
"        </sup>",
"        ; not to exceed 900 mg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        900 mg PO twice weekly",
"        <sup>",
"         &Delta;",
"        </sup>",
"        for nine months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        900 mg PO twice weekly",
"        <sup>",
"         &Delta;",
"        </sup>",
"        for six months",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"8\">",
"        <strong>",
"         Isoniazid and rifapentine",
"        </strong>",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Isoniazid (orally once weekly for 12 doses, given by direct observation)",
"       </td>",
"       <td class=\"sublist1_start\" rowspan=\"8\">",
"        (Further study needed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        15 mg/kg, rounded up to the nearest 50 or 100 mg; 900 mg maximum",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Rifapentine (orally once weekly for three months, given by direct observation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 to 14 kg: 300 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        14.1 to 25 kg: 450 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        25.1 to 32 kg: 600 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        32.1 to 49.9 kg: 750 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &gt;50 kg: 900 mg maximum",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Rifampin",
"        </strong>",
"       </td>",
"       <td>",
"        600 mg PO daily for four months",
"       </td>",
"       <td>",
"        10 to 20 mg/kg PO daily for six months; not to exceed 600 mg/day",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Isoniazid and rifampin",
"        </strong>",
"       </td>",
"       <td>",
"        Isoniazid 300 mg PO daily for three months",
"       </td>",
"       <td>",
"        Isoniazid 10 to 15 mg/kg PO daily for three months; not to exceed 300 mg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rifampin 600 mg PO daily for three months",
"       </td>",
"       <td>",
"        Rifampin 10 to 20 mg/kg PO daily for three months; not to exceed 600 mg/day",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Pyridoxine supplementation (25 to 50 mg PO daily for adults; 1 to 2 mg/kg PO daily for children &lt;12) should be considered for patients on prolonged isoniazid; this is especially important for patients with conditions that can predispose to neuropathy (including diabetes, uremia, alcoholism, malnutrition, and HIV infection), as well as in the setting of pregnancy and seizure disorders. In addition, pyridoxine should be administered to infants of breastfeeding mothers receiving isoniazid. Among children on isoniazid, pyridoxine is warranted for exclusively breastfed infants, children on meat- and milk-deficient diets, children with nutritional deficiencies, and symptomatic HIV-infected children.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Six-month regimens of isoniazid are not appropriate for children.",
"      <br>",
"       &Delta; Twice-weekly regimens must be administered with directly observed therapy (DOT).",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Patient categories for which this regimen has been studied, and patient categories for which this regiemn is NOT appropriate (until further data are available), are discussed in the text. (Refer to UpToDate topic on treatment of latent TB infection in HIV-negative adults, section on isoniazid and rifapentine).",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from:",
"     <br>",
"      <ol>",
"       <li>",
"        Blumberg HM, Leonard MK Jr, Jasmer RM. Update on treatment of tuberculosis and latent tuberculosis infection. JAMA 2005; 293:2776.",
"       </li>",
"       <li>",
"        Recommendations for Use of an Isoniazid-Rifapentine Regimen with Direct Observation to Treat Latent Mycobacterium tuberculosis Infection. MMWR 2011; 60(48):1650.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
