" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 501px\">",
"   <div class=\"ttl\">",
"    Primary and secondary antibody responses to tetanus and diphtheria antigens",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 481px; height: 349px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Antigen is administered at the time indicated on the X axis.&nbsp;Time on the&nbsp;X axis&nbsp;is not marked with units&nbsp;since the course of the response will vary greatly depending on the dose of antigen, the route of administration, and whether the antigen persists in the body or is rapidly cleared. For many protein or glycoprotein antigens not associated with an ongoing infection, the time course of the response ranges from two to four weeks. In the primary response, there is an initial lag period, and then IgM is produced initially, followed later by IgG.&nbsp; In the&nbsp;secondary response, there is a&nbsp;much shorter lag period. The initial rise in antibody production is more rapid, and the total amount produced is greater than in the&nbsp;primary response. In addition, there is a predominance of the IgG isotype (although IgM antibodies are produced as well), and the antibodies have higher affinity for antigen.",
"    <div class=\"footnotes\">",
"    </div>",
